import pytest
from server.worker import Worker, ImageWorker
from hair_segmentation.hair_color.hair_artist import Hair_Artist
from time import sleep
import sys
import numpy
import base64
from io import BytesIO

# Test the Hair_Artist class initialization.
def test_hair_artist():
    ha = Hair_Artist()
    assert ha.mpFace != None
    assert ha.model != None

# Define a pytest fixture for creating a Hair_Artist object.
@pytest.fixture
def hair_artist():
    return Hair_Artist()

# Define a pytest fixture for a base64-encoded JPEG image string.
@pytest.fixture
def base64_img_str_jpeg():
    return ""


# Test the full functionality of the Worker class.
def test_worker_full(hair_artist, base64_img_str_jpeg):
    worker = Worker(hair_artist)

    # Check initial state of worker queues.
    assert len(worker.to_process) == 0
    assert len(worker.to_output) == 0

    # Enqueue input and check the output frame.
    worker.enqueue_input((base64_img_str_jpeg, [129, 10, 233]))

    fr = worker.get_frame
    assert fr != None

    # Enqueue multiple inputs and then clean up.
    for _ in range(10):
        worker.enqueue_input((base64_img_str_jpeg, [129, 10, 233]))
    worker.clean_up()

    # Check final state of worker queues.
    assert len(worker.to_process) == 0
    assert len(worker.to_output) == 0

# Test Worker class initialization with no Hair_Artist object.
# It should raise an exception.
def test_worker_empty():
    with pytest.raises(Exception) as f:
        worker = Worker()


def test_image_worker_full(hair_artist, base64_img_str_jpeg):
    worker = ImageWorker(hair_artist)
    img_bytes = BytesIO(base64.b64decode(base64_img_str_jpeg))
    fr = worker.process_one(img_bytes, [129, 10, 233])
    assert fr != None


def test_image_worker_empty():
    with pytest.raises(Exception) as f:
        worker = ImageWorker()